import MachinesIcon from "../images/dumbbell.png";
import PersonalTrainerIcon from "../images/personal.png";
import MembershipIcon from "../images/membership.png";
import CountUp from 'react-countup';
import { Trainers, gyminfo, trainerInfo } from "./Data";
import { useEffect, useState } from "react";


const GymInfos = (props) => {


    const [details, setDetails] = useState([])
    let t = 0;


    useEffect(() => {
        if (props.type === "gym") {
            setDetails(gyminfo)
        } else {
            setDetails(trainerInfo)
            t++

        }
    })


    let i = 0;

    return (
        <div className="three-gym-info">
            {details.map((data) => {
                return (
                    <div className="gym-info" key={data.id} id={data.id}>


                        <div className="info-holders">
                            <img className="info-icon" src={data.icon} />
                        </div>
                        <div className="info-holders">
                            {Trainers.map((trainer) => (
                                props.id === trainer.id &&
                                <CountUp start={trainer.certificates.no} end={trainer.certificates.start} delay={0} duration={trainer.certificates.duration} enableScrollSpy>
                                    {({ countUpRef }) => (
                                        <div >
                                            <span className="info-number" ref={countUpRef} /><br />
                                        </div>
                                    )}
                                </CountUp>
                            ))}
                            <span className="info-desc">{data.title.toUpperCase()}</span>
                        </div>
                    </div>
                )
            })}

        </div>
    )

}

export default GymInfos;
